import React, { useState} from 'react';
import APIService from '../../APIService';
import IconPic from '../../images/IsseLogo2.png';
import {
  UploadContainer,
  UploadWrapper,
  UploadContTop,
  UploadContBottom,
  Icon,
  Img,
  Form,
  FormH1,
  UploadIcon,
  FormButton,
  FormLabel,
  FormSelect,
  ContLeft,
  ContRight,
  Cont,
  ContMessage,
  FormButtonBrowse,
} from './UploadElements';

const Upload = () => {
 /*  
  const [title, setTitle] = useState('')
  const [pdffile, setBody] = useState('')

  useEffect(() => {
      setTitle(props.resume.title)
      setDescription(props.resume.pdffile)

  }, [props.resume])

  const insertResume = () => {
      APIService.InsertResume({title, pdffile})
      .then(resp => props.insertedInformation(resp))
  } */

  return (
    <React.Fragment>
      <UploadContainer>
        <UploadWrapper>
          <UploadContTop>
            <Icon to='/'>
              <Img alt = 'logo' src={IconPic}></Img>
            </Icon>
          </UploadContTop>
          <UploadContBottom>
            <Form className="Upload-form" >
              <FormH1>Upload Form</FormH1>
                <Cont>
                <ContLeft>
                  <FormLabel For='select'>Select File</FormLabel>
                  <FormSelect type='file' name='select' required />
                </ContLeft>
                <ContRight>
                  <FormLabel For='browse'>Browse</FormLabel>
                  <FormButtonBrowse><UploadIcon/></FormButtonBrowse>
                </ContRight>
                </Cont>
              <FormButton type='submit'>Upload</FormButton>
              <ContMessage></ContMessage>
            </Form>
        </UploadContBottom>
        </UploadWrapper>
      </UploadContainer>
    </React.Fragment>
  );
};

export default Upload;
